import React from 'react'

let diets = ["omnivore", "vegetarian", "vegan", "pussy"]
function PopulateDiet() {
     return diets.map(diet => {
         return <option value = {
             diet.name
         } > {
             diet.name
         } </option>;
     })
}

export default PopulateDiet
